import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";

// Navbar Component
const Navbar = () => (
  <nav>
    <ul>
      <li><a href="/">Home</a></li>
      <li><a href="/about">About</a></li>
      <li><a href="/skills">Skills</a></li>
      <li><a href="/projects">Projects</a></li>
      <li><a href="/contact">Contact</a></li>
    </ul>
  </nav>
);

// Footer Component
const Footer = () => (
  <footer>
    <p>Â© 2025 Your Name. All rights reserved.</p>
  </footer>
);

// Home Component
const Home = () => (
  <section>
    <h1>Welcome to My Portfolio</h1>
    <p>Hi, I'm [Your Name], a passionate developer.</p>
  </section>
);

// About Component
const About = () => (
  <section>
    <h1>About Me</h1>
    <p>Details about your background, education, and journey.</p>
  </section>
);

// Skills Component
const Skills = () => (
  <section>
    <h1>Skills</h1>
    <p>List of technical and soft skills with visuals.</p>
  </section>
);

// Projects Component
const Projects = () => (
  <section>
    <h1>Projects</h1>
    <p>Showcase of 3-5 projects with descriptions and links.</p>
  </section>
);

// Contact Component
const Contact = () => (
  <section>
    <h1>Contact</h1>
    <p>Contact form and social media links.</p>
  </section>
);

// Main App Component
const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/skills" element={<Skills />} />
        <Route path="/projects" element={<Projects />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
      <Footer />
    </Router>
  );
};

export default App;
